import React from "react";
import { Menu } from "semantic-ui-react";

const items = [
  { key: "editorials", active: true, name: "Editorials" },
  { key: "review", active: true, name: "Review" },
  { key: "events", active: true, name: "Events" }
];

const Header = () => {
  <Menu items={items} />;
};

export default Header;
